import React from 'react';
import Room from './Room/Room';

const RoomList = (props) => {
	console.log("props", props.data, Object.keys(props.data));

	const transformedData = Object.keys(props.data).map( igKey => {
		return [...Array(props.data[igKey])].map((data,index) => {
		return <Room type={igKey} key = {data['key']} data = {data}/>
	})
	}).reduce( (arr,curr) => arr.concat(curr), []);
	console.log("transformedIngredients", transformedData);
  return (
  		<div>
  		{transformedData}
  		</div>
  	)
}

export default RoomList;
